// Import statements...

function UsersList() {
    // ... (existing code)

    return (
        <div className='usersList'>
            <table className='users-table'>
                <thead>
                    <tr>
                        <th>User Name</th>
                        <th>Email</th>
                        <th colSpan={2}>Status</th>
                        <th>Remove</th>
                    </tr>
                </thead>
                <tbody>
                    {users && users.map((element, index) => (
                        <tr key={index}>
                            <td>{element.userName}</td>
                            <td>{element.email}</td>
                            <td><Button variant="success" as={Link}>Active</Button></td>
                            <td><Button variant="dark" as={Link}>Inactive</Button></td>
                            <td><Button variant="danger" as={Link} onClick={() => deleteAccount(element._id)}>Remove</Button>{' '}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default UsersList;

           
